import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import LoginPage from './LoginPage';
import StudentDashboard from './studentdashboard';
import CoordinatorDashboard from './coordinatordashboard';
import StudentProfile from './studentprofile';
import CoordinatorProfile from './coordinatorprofile';

const App = () => {
  return (
    <Router>
      <Switch>
        {/* Route for Login Page */}
        <Route path="/Login" component={LoginPage} />

        {/* Route for Dashboards */}
        <Route path="/dashboard/student" component={StudentDashboard} />
        <Route path="/dashboard/coordinator" component={CoordinatorDashboard} />

        {/* Route for Profiles */}
        <Route path="/profile/student" component={StudentProfile} />
        <Route path="/profile/coordinator" component={CoordinatorProfile} />
      </Switch>
    </Router>
  );
};

export default App;
